pragma solidity >=0.4.0 <0.9.0;
// pragma experimental ABIEncoderV2;
contract SemDetails{
  struct  profile{
    string name;
    string email;
    uint256 phone;
  }
  mapping(address=>profile) mappedData;
  struct semdetails{
    fixed gpa;
  }
     profile  s;
     function setProfile(string memory name,string memory email,uint256 phone) public {
         mappedData[msg.sender]=profile(name,email,phone);
        //  console.log(mappedData['0x5B38Da6a701c568545dCfcB03FcB875f56beddC4']);
     }
     function getProfile(address add) public view returns(string memory _name,string memory _email,uint256 _phone){
       string memory name=mappedData[add].name;
       string memory email=mappedData[add].email;
       uint256 phone =mappedData[add].phone;
       return(name,email,phone);
     }
    //  function getProfile(address a) view public return()
}
